import { Link } from "react-router-dom";
import { Button, Container, Row } from "react-bootstrap";
import "./css/landingPage.css";
import Navbar from "../Components/navbar";

function LandingPage() {
    return (
    <>
    <Navbar/>
    <main className="LandingPageBody">
        <div id="welcome-message">
            <h2 id="titleLanding">Bem vindo(a)</h2>
            <p>Esse site é um gerenciador de eventos, você pode adicionar, remover e editar eventos, que possuem data de início e final, além de uma descrição.</p>
        </div>
    </main>
    <footer id="footer-landingPage">Made by Fellip</footer>
    </>
    );
}

export default LandingPage;
